script: |
  super -f text -I q5326.spq | sort > q5326.out

inputs:
  - name: q5326.spq
    data: |
      SELECT + col1 + - - 74 + + + col0 AS col0, col0 + - + col2 AS col1 FROM tab0 (FORMAT parquet) cor0 WHERE NOT ( CAST ( NULL AS INTEGER ) + - - col2 ) >= NULL;
  - name: tab0

outputs:
  - name: q5326.out
    data: |
